import styled from "styled-components";
import { colors } from "../locales/colors";
import { margin } from "./Constants";
import { GridBox } from "./MainScreen";

export const ListHandleBox = styled.div`
  z-index: 2;
  max-height: 280px;
  min-height: 280px;
  min-width: 200px;
  max-width: 200px;
  border-radius: 30px;
  margin: ${margin.xsPrc} ${margin.xsPrc} ${margin.xsPrc} ${margin.xsPrc};
  display: flex;
  flex-direction: column;
  box-shadow: 0px 0px 0px 1px ${colors.foodBorder} inset;
`;
export const GridMyListBox = styled.div`
  min-height: 100%;
  width: 80%;
  display: flex;
  margin: ${margin.ml} 0 0 0;
  flex-wrap: wrap;
`;

export const ListHandleButtonBox = styled.div`
  flex: 1;
  min-height: 40px;
  cursor: pointer;
  display: flex;
  padding: 0 0 0 5%;
  flex-direction: column;
  align-items: flex-start;
`;

export const ListFoodBox = styled.div`
  padding: 10px 10px 10px 0px;
`;
export const ListButtonBox = styled.div`
  width: 40%;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px 0 0 5%;
`;
